import autumn from './images/autumn.jpeg';
import blueflower from './images/blue-flower.jpeg';
import blurredlight from './images/blurred-light.jpeg';
import cold from './images/cold.jpeg';
import lonelytree from './images/lonely-tree.jpeg';
import lotus from './images/lotus.jpeg';
import mapleleaf from './images/maple-leaf.jpeg';
import grapeclusters from './images/grapeclusters.jpeg';
import railroad from './images/railroad.jpeg';
import red from './images/Sonic.jpeg';
import swans from './images/raptors.jpeg';
import waterfall from './images/leafs-logo-620.jpg';

const images = [
  autumn,
  blueflower,
  blurredlight,
  cold,
  lonelytree,
  lotus,
  mapleleaf,
  grapeclusters,
  railroad,
  red,
  swans,
  waterfall
];

export default images;
